import React, { useState } from 'react';
import './DoctorDetail.css';

const DoctorDetail = () => {
  const [doctorInfo] = useState({
    fullName: 'John Doe',
    idCard: '123456789',
    gender: 'Male',
    dob: '01/01/1990',
    phoneNumber: '1234567890',
    email: 'johndoe@example.com',
    address: '123 Street, City',
    diploma: 'Bachelor of Dental Surgery',
    experience: '5 years',
  });

  const [workdays, setWorkdays] = useState([]);
  const [selectedDate, setSelectedDate] = useState('');

  const handleWorkdayClick = (index) => {
    const updatedWorkdays = [...workdays];
    updatedWorkdays[index] = !updatedWorkdays[index];
    setWorkdays(updatedWorkdays);
  };

  const handleDateChange = (event) => {
    setSelectedDate(event.target.value);
  };

  return (
    <div className="doctor-detail">
      <div className="avatar-container">
        <img src="https://via.placeholder.com/150" alt="Doctor Avatar" className="doctor-avatar" />
      </div>
      <div className="info-container">
        <h2 className="doctor-name">{doctorInfo.fullName}</h2>
        <div className="doctor-info">
          <p className="info-label">Số CMND:</p>
          <p className="info-value">{doctorInfo.idCard}</p>
        </div>
        <div className="doctor-info">
          <p className="info-label">Giới tính:</p>
          <p className="info-value">{doctorInfo.gender}</p>
        </div>
        <div className="doctor-info">
          <p className="info-label">Ngày sinh:</p>
          <p className="info-value">{doctorInfo.dob}</p>
        </div>
        <div className="doctor-info">
          <p className="info-label">Số điện thoại:</p>
          <p className="info-value">{doctorInfo.phoneNumber}</p>
        </div>
        <div className="doctor-info">
          <p className="info-label">Email:</p>
          <p className="info-value">{doctorInfo.email}</p>
        </div>
        <div className="doctor-info">
          <p className="info-label">Địa chỉ:</p>
          <p className="info-value">{doctorInfo.address}</p>
        </div>
        <div className="doctor-info">
          <p className="info-label">Bằng cấp:</p>
          <p className="info-value">{doctorInfo.diploma}</p>
        </div>
        <div className="doctor-info">
          <p className="info-label">Kinh nghiệm:</p>
          <p className="info-value">{doctorInfo.experience}</p>
        </div>
        <div className="workday-container">
          <p className="workday-label">Ngày làm việc:</p>
          <input
            type="date"
            value={selectedDate}
            onChange={handleDateChange}
            className="workday-input"
          />
        </div>
        <div className="timeslot-container">
          <p className="timeslot-label">Ca làm việc:</p>
          {workdays.map((isWorkday, index) => (
            <button
              key={index}
              className={`timeslot-button ${isWorkday ? 'selected' : ''}`}
              onClick={() => handleWorkdayClick(index)}
            >
              {`${index + 7} - ${index + 8}h`}
            </button>
          ))}
        </div>
        <div className="edit-button-container">
          <button className="edit-button">Chỉnh sửa thông tin</button>
        </div>
      </div>
    </div>
  );
};

export default DoctorDetail;
